d Tops in Finals \u0026amp; Semi-Finals by Year\" responsive=\"true\" scale=\"1.0\" src=\"ref://56ad6af345\"/\u003e\u003cText label=\"Analysis\"\u003e\u003c![CDATA[### This explains the Speed box plots  \nThe horizontal lines bottom and top are the min and max values  \nThe line across the waist of the box is the median value  \nThe bottom and top of the box are the 1st and 3rd quartile values  \nThe dots at the top are statistical outliers  \n\n  Hover on a box and it will show all the values  \n\n### Speed Analysis  \nparticuluarly in the Mens results you can see the height of the box has shrunk meaning the times of the majority and getting closer  \n2021 only had 2 events so doesn\u0027t have as much variation as normal years with more events.  \nThe times before 2012 were so slow you couldn\u0027t see the detail in the later years  \nThis is qualifying times only, the finals times are harder to collate as the format on the IFSC website has changed over the years  \n\n### Lead Analysis  \nThis show that generally there are more tops in female lead comps than there are in mens, this indicates the women are not being challenged as much as the men.  \nIn Finals in 12 of the last 16 years there have been more female tops, only 2 years where there were more tops, and 2 years where they were the same.]]\u003e\u003c/Text\u003e\u003c/Select\u003e\u003c/Group\u003e\u003c/Select\u003e\u003c/View\u003e", "assets": {"9f54885c14": {"src": "data:application/vnd.datapane.table+html;base64,PHN0eWxlIHR5cGU9InRleHQvY3NzIj4KI1RfZTcwMjlfICB7CiAgYm9yZGVyOiAycHggc29saWQgYmxhY2s7Cn0KI1RfZTcwMjlfcm93MF9jb2wxIHsKICB3aWR0aDogMTBlbTsKICBoZWlnaHQ6IDgwJTsKICBiYWNrZ3JvdW5kOiBsaW5lYXItZ3JhZGllbnQoOTBkZWcsbGlnaHRibHVlIDEwMC4wJSwgdHJhbnNwYXJlbnQgMTAwLjAlKTsKfQojVF9lNzAyOV9yb3cxX2NvbDEgewogIHdpZHRoOiAxMGVtOwogIGhlaWdodDogODAlOwogIGJhY2tncm91bmQ6IGxpbmVhci1ncmFkaWVudCg5MGRlZyxsaWdodGJsdWUgNzguOSUsIHRyYW5zcGFyZW50IDc4LjklKTsKfQojVF9lNzAyOV9yb3cyX2NvbDEsICNUX2U3MDI5X3JvdzNfY29sMSB7CiAgd2lkdGg6IDEwZW
